DROP TABLE IF EXISTS `data_task`;
CREATE TABLE `data_task` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `userid` bigint(20) DEFAULT NULL,
  `groupid` bigint(11) DEFAULT NULL,
  `subtaskurl` varchar(255) DEFAULT NULL,
