  `istoptask` tinyint(1) DEFAULT NULL,
  `code` varchar(255) DEFAULT NULL,
  `city` varchar(255) DEFAULT NULL,
  `type` varchar(20) DEFAULT NULL,
  `programname` varchar(255) DEFAULT NULL,
  `name` varchar(255) DEFAULT NULL,
  `datatype` varchar(20) DEFAULT NULL,
  `website` varchar(255) DEFAULT NULL,
  `webpage` varchar(255) DEFAULT NULL,
  `start` int(11) DEFAULT NULL,
  `end` int(11) DEFAULT NULL,
  `period` int(11) DEFAULT NULL,
  `sleep_interval` bigint(20) DEFAULT NULL COMMENT '线程休眠时间',
  `isproxy` tinyint(1) DEFAULT NULL,
  `islive` tinyint(2) DEFAULT NULL,
  `programparams` varchar(255) DEFAULT NULL,
  `creation_date` bigint(20) DEFAULT NULL,
  `modification_date` bigint(20) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=20151229 DEFAULT CHARSET=utf8;

